import { FileUtility } from './file.utility';
import { WindowUtility } from './window.utility';

describe('FileUtility', () => {
  it('should test utility to getFileType', () => {
    expect(FileUtility.getFileType('abc.pdf')).toBe('application/pdf');
    expect(FileUtility.getFileType('abc.xls')).toBe('application/vnd.ms-excel');
    expect(FileUtility.getFileType('abc.xlsx')).toBe(
      'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet'
    );
    expect(FileUtility.getFileType('abc.doc')).toBe('application/msword');
    expect(FileUtility.getFileType('abc.docx')).toBe(
      'application/vnd.openxmlformats-officedocument.wordprocessingml.document'
    );
    expect(FileUtility.getFileType('abc.docx')).toBe(
      'application/vnd.openxmlformats-officedocument.wordprocessingml.document'
    );
    expect(FileUtility.getFileType('test')).toBe(undefined);
  });

  it('downloadDocument', () => {
    const base64Data =
      '';

    let spy = spyOn(WindowUtility, 'msSaveOrOpenFile').and.callThrough();
    FileUtility.downloadDocument(base64Data, 'abc.pdf');
    expect(spy).toHaveBeenCalledTimes(0);
    spyOnProperty(window, 'navigator', 'get').and.returnValue({
      msSaveOrOpenBlob: function () {
        return true;
      },
    });
    FileUtility.downloadDocument(base64Data, 'abc.pdf');
    expect(spy).toHaveBeenCalledTimes(1);
  });

  it('createDocument', () => {
    expect(function () {
      FileUtility.createDocument(undefined, 'application/pdf');
    }).toThrow();
  });
});
